import React from 'react';
import icon from './search-icon.svg';
import './SearchBar.css';

function SearchBar() {
    return(
        <div className="SearchBar">
            <input name="searchBar"><h3>Type here for the song</h3></input>
            <img alt="search icon" src={icon} className="searchIcon"></img>
        </div>
    )
};

export default SearchBar;
